  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Oak Orchard National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1960.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, and
  raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments. The public relations section of the report describes recreational
  uses, Refuge visitors, and Refuge participation. Photographs are attached.\",\n\t\"owner_org\":
